import React from 'react';
import './nightModeToggle.css'

function NightMode() {
  return (
    <div className='nightMode' >
        <h4>Night Mode</h4>
        <label className="switch">
          <input type="checkbox" />
          <span className={"slider round"}></span>
        </label>
    </div>
  );
}

export default NightMode;
